import React from "react";
import Messagebar from "./messagebar";
import "./footer.css";

const Footer = (props) => {
  return (
    <div className="footer">
      <Messagebar message={props.message} setMessage={props.setMessage} sendMessage={props.sendMessage} />
    </div>
  );
};

export default Footer;
